import React, { Component } from 'react'

import {
    MDBCollapse,
    MDBCard,
    MDBCardBody,
    MDBCardHeader,
    MDBIcon,
  } from 'mdbreact';
  import axios from 'axios';
  import FilterResults from 'react-filter-search';




export class QuestionsandAnswers extends Component {

    constructor(props) {
        super(props);
        this.state = {
          data: [],
          value: ''
        };
      }
      componentWillMount() {
        fetch('https://jsonplaceholder.typicode.com/users')
          .then(response => response.json())
          .then(json => this.setState({ data: json }));
      }
      handleChange = event => {
        const { value } = event.target;
        this.setState({ value });
      };


    state = {
        collapseID: false,
        persons: [],
        search: '',
      };

      toggleCollapse = collapseID => () =>
        this.setState(prevState => ({
          collapseID: prevState.collapseID !== collapseID ? collapseID : ''
        }));

        componentDidMount() {
            axios.get(`https://dev.api.cpcompass.ng/faq`)
              .then(res => {
                const persons = res.data.data.faq;
                console.log(persons);
                this.setState({ persons });
              })
          }

    render() {
        const { data, value } = this.state;

        return (
            <div>

<div>
        <input type="text" value={value} onChange={this.handleChange} />
        <div
          value={value}
          data={data}
          renderResults={results => (
            <div>
              {results.map(el => (
                <div>
                  <span>{el.name}</span>
                  <span>{el.email}</span>
                </div>
              ))}
            </div>
          )}
        />
      </div>

                <div className="container-fluid faq">
                    <div id="margin_space3" className="row"
                        data-aos="fade-down"
                        data-aos-easing="linear"
                        data-aos-duration="1500"
                    >

                        <div className="col-md-12">
                            <div className="text-center questions">
                              <h1>Got questions? weâ€™ve got answers</h1>
                                <div className="buttonIn"> 
                                    <input className="form-control" type="text" id="enter" placeholder="Search for answers"/> 
                                    <button id="clear">Search</button> 
                                </div> 
                            </div>
                        </div>

                    </div>
                </div>



                <div className="container-fluid">
                    <div id="margin_space3" className="row">
                        <div className="col-md-12">
                            <div className="accordion_balancing">
                            { this.state.persons.map(person =>
                                <MDBCard id="accordion_card">

                                    <MDBCardHeader id={this.state.collapseID === 'collapse' + person.id ? 'your_className': null}
                                    onClick={this.toggleCollapse('collapse'+person.id)}
                                    tagClassName=''
                                    className="accordion_faq"
                                    >
                                     <h1>
                                         {person.title}

                                    <MDBIcon
                                        icon={
                                        this.state.collapseID === 'collapse' + person.id
                                            ? 'minus'
                                            : 'plus'
                                        }
                                        className='float-right'
                                        size='1x'
                                    />
                                    </h1>
                                    </MDBCardHeader>

                                    <MDBCollapse id={'collapse' + person.id} isOpen={this.state.collapseID}>
                                    <MDBCardBody className='pt-0'>
                                    <br/>
                                        <p className="accordion_faq_para">{person.content}</p>
                                    </MDBCardBody>
                                    </MDBCollapse>
                                </MDBCard>
                                 )}

                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}


export default QuestionsandAnswers
